import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia";
function createEmoji(emojis) {

  return <Entry
    Key={emojis.id}
    name={emojis.name}
    emoji={emojis.emoji}
    meaning={emojis.meaning}
  />

}
function App() {

  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      <dl className="dictionary">
        {emojipedia.map(createEmoji)};
      </dl>
    </div>
  );
}

export default App;
